  true,\n\t\"url\": null,\n\t\"notes\": \"The Environmental Compliance and Laboratory
  Services Division of the Bureau of Water and Wastewater is responsible for monitoring
  the quality of the streams and Harbor in the City of Baltimore. The purpose of this
  program is to evaluate the quality of our surface waters for any long-term trends
  and determine any capital investment programs or operational programs to implement.
  \ The results may be affected by a variety of factors: precipitation, land use changes,
  and human behavior.  For more information: http://cleanwaterbaltimore.org/\",\n\t\"license_title\":
